import {Route, Switch} from "react-router-dom";

const QuoteDetail = () => {
    return (
        <Switch>
            <Route path='/quotes'/>
            <Route path='/quotes/:quotesId'/>
            <Route path='/new-quote'/>
        </Switch>
    );
}

export default QuoteDetail;
